import { Route } from "react-router-dom";

import LandingPage from "./pages/LandingPage";
import LoginPage from "./pages/LoginPage";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/landingpage">
          <LandingPage />
        </Route>
        <Route path="/login">
          <LoginPage />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
